import React from "react";
import "../App.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function Selection() {
  return (
    <React.Fragment>
      <h2>Accounts</h2>
      <ul>
        <li>
          <Link to="/editor">Netflix</Link>
        </li>
      </ul>
    </React.Fragment>
  );
}

export default Selection;
